package com.mycompany.veterinaria.controller;import com.mycompany.veterinaria.model.Duenho;import com.mycompany.veterinaria.service.DuenhoService;import com.mycompany.veterinaria.service.IDuenhoService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.web.bind.annotation.DeleteMapping;import org.springframework.web.bind.annotation.GetMapping;import org.springframework.web.bind.annotation.PostMapping;import org.springframework.web.bind.annotation.PutMapping;import org.springframework.web.bind.annotation.RequestBody;import org.springframework.web.bind.annotation.RequestMapping;import org.springframework.web.bind.annotation.RequestParam;import org.springframework.web.bind.annotation.RestController;import java.util.List;@RestController@RequestMapping("/api/due√±o")public class DuenhoController {    @Autowired    private IDuenhoService duenhoService;    @GetMapping("/get")    public List<Duenho> getDuenhos (){        return  duenhoService.getDuenhos();    }    @DeleteMapping("/delete")    public String deleteDuenho (@RequestParam Long idDuenho){        duenhoService.deleteDuenho(idDuenho);        return "Duenho eliminado";    }    @GetMapping("/get/one")    public Duenho findDuenho (@RequestParam Long idDuenho){        Duenho duenho = duenhoService.findOneDuenho(idDuenho);        return  duenho;    }    @PutMapping ("/edit")    public Duenho editDuenho (@RequestBody Duenho duenho){        duenhoService.editDuenho(duenho);        return  duenhoService.findOneDuenho(duenho.getIdDuenho());    }    @PostMapping("/save")    public String saveDuenho (@RequestBody Duenho duenho){        duenhoService.saveDuenho(duenho);        return  "Duenho creado";    }}